  \"2013-03-14T19:23:49.241340\",\n\t\"name\": \"eureka-littoral-cell-crsmp-humboldt-bay-mean-monthly-maximum-water-elevation-2011\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Humboldt Bay Shoreline Assessment and
  LiDAR Analysis was conducted by field mapping the entire shoreline and assigning
  an unique segment identifier based on a change in attributes of type, structure,
  cover, and salt marsh adjacency onto 11x17 aerial photo base maps at a scale of
  1u201d = 200u2019. Once field mapped shoreline segments were digitized and attributed
  in GIS. In early 2012 the NOAA Coastal LiDAR dataset became available as a u201chydro-flattened
  bare earthu201d digital elevation model (DEM). Metadata provided with the DEM reported
  a vertical accuracy RMSE less than or equal to 18 cm and a horizontal accuracy of
  50 cm RMSE or better. A subset of the LiDAR DEM was taken that included all portions
  of the Humboldt Bay shoreline. A contour layer was derived from the DEM and the
  DEM was color coded in 0.5 meter elevation increments. Digitized artificial shoreline
  segments were realigned with the contours and color coded DEM to ensure that the
  segments were aligned with the structures which they represent. Jeff Anderson of
  Northern Hydrology prepared a DEM of Humboldt Bay representing water surface elevations
  of the present day mean monthly maximum water surface (MMMW). The MMMW surface was
  subtracted from the LiDAR DEM to produce a third DEM of relative elevations to the
  MMMW. These relative elevations were assigned to the shoreline segments at one meter
  spacing as the DEM is comprised of a one meter pixel resolution. The 1 meter spaced
  vertices of the shoreline segments were exported to a 3D point feature class. The
  shoreline segments were then broken at each vertex to produce 169,903 1 meter shoreline
  segments which all contained the original unique segment identifier, shoreline attributes,
  and start and end relative elevation values in the attribute table. An average relative
  elevation was calculated for each one meter shoreline segment and used as the basis
  for analysis.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
